import React, { useState } from 'react';
import { Link } from 'react-router-dom';
const StudentDashboard = () => {
  const [chatMessages, setChatMessages] = useState([]);
  const [newMessage, setNewMessage] = useState('');

  const handleButtonClick = (buttonName) => {
    // Add functionality for the buttons here
    alert(`Button Clicked: ${buttonName}`);
  };

  const handleChatInputChange = (event) => {
    setNewMessage(event.target.value);
  };

  const handleSendChatMessage = () => {
    if (newMessage) {
      setChatMessages([...chatMessages, newMessage]);
      setNewMessage('');
    }
  };

  return (
    <div>
      <header>
        <h1>MS in DS Academic Program</h1>
      </header>
      <nav>
        <a href="Files.html">Files</a>
        <a href="Grades.html">Grades</a>
        <a href="Appointments.html">Appointments</a>
        <a href="Messages.html">Messages</a>
        <a href="index.html">Logout</a>
      </nav>
      <div className="container">
        <div className="content">
          <div className="dashboard">
            <div className="section">
              <h2>CSE 5321-001</h2>
              <button onClick={() => handleButtonClick('ANALYTICS')}>ANALYTICS</button>
              <button onClick={() => handleButtonClick('TAKE AN ASSESSMENT')}>TAKE AN ASSESSMENT</button>
              <button onClick={() => handleButtonClick('REPORTS')}>REPORTS</button>
            </div>
            <div className="section">
              <h2>CSE 5334-004</h2>
              <button onClick={() => handleButtonClick('ANALYTICS')}>ANALYTICS</button>
              <button onClick={() => handleButtonClick('REPORTS')}>REPORTS</button>
              <button onClick={() => handleButtonClick('TAKE AN ASSESSMENT')}>TAKE AN ASSESSMENT</button>
            </div>
            <div className="section">
              <h2>CSE 6324-003</h2>
              <button onClick={() => handleButtonClick('ANALYTICS')}>ANALYTICS</button>
              <button onClick={() => handleButtonClick('REPORTS')}>REPORTS</button>
              <button onClick={() => handleButtonClick('TAKE AN ASSESSMENT')}>TAKE AN ASSESSMENT</button>
            </div>
          </div>
        </div>
        <div className="chat-box">
          <div className="close-button">X</div>
          <div className="chat-title">Welcome to the Chatbox!!</div>
          <div className="chat-content">
            {chatMessages.map((message, index) => (
              <div key={index}>{message}</div>
            ))}
          </div>
          <input
            type="text"
            className="chat-input"
            placeholder="Type here"
            value={newMessage}
            onChange={handleChatInputChange}
          />
          <button className="chat-button" onClick={handleSendChatMessage}>
            SEND
          </button>
        </div>
      </div>
      <footer>
        <p>@ copyright MS in DS Academic Program</p>
      </footer>
    </div>
  );
};

export default StudentDashboard;
